// src/app/mainpage/mainpage.component.ts
import { Component, ViewChild, ElementRef, OnInit } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';

@Component({
  selector: 'app-mainpage',
  templateUrl: './mainpage.component.html',
  styleUrls: ['./mainpage.component.css']
})
export class MainPageComponent implements OnInit {
  formGroup: FormGroup;
  cardItems: string[] = [
    'مطلب ترسيم', 'سند ملكية', 'نسخة من سند ملكية', 'شهادة ملكية',
    'شهادة اشتراك في الملكية', 'شهادة في عدم الملكية', 'شهادة إعفاء من رسوم عقارية',
    'نسخة مطابقة للأصل من وثيقة', 'شهادة في مراجع تسجيل عقد', 'الإطلاع على رسم عقاري'
  ];

  @ViewChild('scrollableContainer', { static: false }) scrollableContainer: ElementRef | undefined;

  currentDate: string = '';

  constructor(private fb: FormBuilder) {
    this.formGroup = this.fb.group({
      // Your form controls here
    });
  }

  ngOnInit(): void {
    // Initialize time function
    this.updateTime();
    setInterval(() => {
      this.updateTime();
    }, 1000); // Update every second
  }

  updateTime() {
    const now = new Date();
    this.currentDate = now.toLocaleTimeString(); // You can customize this as needed
  }

  scrollLeft() {
    if (this.scrollableContainer) {
      this.scrollableContainer.nativeElement.scrollBy({
        left: -200,
        behavior: 'smooth'
      });
    }
  }

  scrollRight() {
    if (this.scrollableContainer) {
      this.scrollableContainer.nativeElement.scrollBy({
        left: 200,
        behavior: 'smooth'
      });
    }
  }

  onSubmit() {
    // Handle form submission logic here
  }
}
